import { Button } from 'antd'
import React from 'react'
import Cuadro from '../../components/Cuadro/Cuadro';
import './Organigrama.scss';




export default function Organigrama() {

    const data = {
        title: "titulo",
        Subtitle: "Subtitulo",
        text: "texto"
    }

    return (
        <div className="square">
            <h1>Organigrama</h1>
            <Button type="primary" onClick={message} >
                With extra props
            </Button>
            <div className="screen">
                <Cuadro data={data} />
            </div>
        </div>
    )
}


const message = () => {

    return(
        <h1>kjhkhkh</h1>
    );
}
